import React from "react";
import Play from "./components/play";
import Users from "./components/users";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selectPage: 1,
    };
  }
  render() {
    return <div>{this.prog}</div>;
  }
  prog = () => {
    {
      this.state.selectPage ? <Users sel={this.state.selectPage} /> : <Play />;
    }
  };
}

export default App;
